        public SubTypesTranslator()
        {
            JsonConvert.DeserializeObject(SubTypeBlob);
            SubTypes = JsonConvert.DeserializeObject<List<SubType>>(SubTypeBlob);
        }
        public void ConvertNodeDisplayTypeToString(ref CustomNode node, ref string token, ref DateTime tokenTime, string userName, string password)
        {
            var thisSubType = long.Parse(node.Node.DisplayType);
            var foundSubType = SubTypes.Find(delegate (SubType st) { return st.subtype == thisSubType; });
            string newSubType = "";
            if (foundSubType == null)
            {
                //unknown subtype
                //TokenRefresher.checkrefresh(ref token, ref tokenTime, userName, password);
                //var thisNode = CWSDocMan.getNode(token, Node.Node.ID);
                //newSubType = thisNode.DisplayType;
            }
            else
            {
                newSubType = foundSubType.subtypename;
            }
            node.TranslatedDisplayType = newSubType;
        }
